import React from "react";
import logo from "./mintbean.png";
var tinycolor = require("tinycolor2");

const appStyle = {
  fontFamily: "sans-serif",
  fontSize: "50px",
  textAlign: "center",
  margin: "6rem 0",
};

function App() {
  return <div style={appStyle}>Color Scheme Selector</div>;
}

export default App;
